import React from 'react';
import Lettering from '../lettering/lettering';
import Section from '../section/section';
import Page from '../page/page';
import './slider.css';

export const foo = 'baa';

export const media = [
  {
    slug: '',
    className: 'slide page-one',
    children: (
      <Lettering
        title="INDEX"
        text={['This is a single full page fixed screen 123 123.']}
      />
    ),
  },
  {
    slug: 'page-two',
    className: 'sectioned page-two',
    children: (
      <Page>
        <Section backgroundColor="#617be3">
          <Lettering
            title="PAGE-TWO"
            text={[
              'This is multiple section page, scroll down to view more content.',
            ]}
          />
        </Section>
        <Section backgroundColor="eb8242">
          <Lettering
            title="PAGE-SECTION"
            text={['This is a continued page section.']}
          />
        </Section>
      </Page>
    ),
  },
  {
    slug: 'page-three',
    className: 'slide page-three',
    children: <Lettering title="PAGE-THREE" />,
  },
];
